import json
import pytest
import logging
import os
from os import environ

BASE_DIR = os.path.dirname(os.path.dirname(os.path.abspath(__file__)))
environ['ACCESS_POINT'] = BASE_DIR + '/model'

from src import porn_image_app


def test_lambda_handler():
    event = {
        'body': {
            "img": ""
        }
    }
    result = porn_image_app.lambda_handler(event=event, context='')
    body = json.loads(result['body'])
    print(body['normal'])
    assert body['normal'] == 0.9246619939804077 \
           and body['sexy'] == 0.027918100357055664 \
           and body['porn'] == 0.04741988331079483
